inline bool VerifyContent(::flatbuffers::Verifier &verifier, const void *obj, Content type) {
  switch (type) {
    case Content_NONE: {
      return true;
    }
    case Content_INNER_CLOSE_CLIENT: {
      auto ptr = reinterpret_cast<const protocol::INNER_CLOSE_CLIENT *>(obj);
      return verifier.VerifyTable(ptr);
    }
    case Content_REQUEST_REGISTER: {
      auto ptr = reinterpret_cast<const protocol::REQUEST_REGISTER *>(obj);
      return verifier.VerifyTable(ptr);
    }
    case Content_RESPONSE_REGISTER: {
      auto ptr = reinterpret_cast<const protocol::RESPONSE_REGISTER *>(obj);
      return verifier.VerifyTable(ptr);
    }
    case Content_REQUEST_HEARTBEAT: {
      auto ptr = reinterpret_cast<const protocol::REQUEST_HEARTBEAT *>(obj);
      return verifier.VerifyTable(ptr);
    }
    case Content_RESPONSE_HEARTBEAT: {
      auto ptr = reinterpret_cast<const protocol::RESPONSE_HEARTBEAT *>(obj);
      return verifier.VerifyTable(ptr);
    }
    case Content_NOTICE_ENTRANCE_STAGE: {
      auto ptr = reinterpret_cast<const protocol::NOTICE_ENTRANCE_STAGE *>(obj);
      return verifier.VerifyTable(ptr);
    }
    case Content_NOTICE_EXIT_STAGE: {
      auto ptr = reinterpret_cast<const protocol::NOTICE_EXIT_STAGE *>(obj);
      return verifier.VerifyTable(ptr);
    }
    case Content_REQUEST_PLAYERMOVE: {
      auto ptr = reinterpret_cast<const protocol::REQUEST_PLAYERMOVE *>(obj);
      return verifier.VerifyTable(ptr);
    }
    case Content_RESPONSE_PLAYERMOVE: {
      auto ptr = reinterpret_cast<const protocol::RESPONSE_PLAYERMOVE *>(obj);
      return verifier.VerifyTable(ptr);
    }
    case Content_NOTICE_PLAYERPOSITION: {
      auto ptr = reinterpret_cast<const protocol::NOTICE_PLAYERPOSITION *>(obj);
      return verifier.VerifyTable(ptr);
    }
    default: return true;
  }
}

inline bool VerifyContentVector(::flatbuffers::Verifier &verifier, const ::flatbuffers::Vector<::flatbuffers::Offset<void>> *values, const ::flatbuffers::Vector<uint8_t> *types) {
  if (!values || !types) return !values && !types;
  if (values->size() != types->size()) return false;
  for (::flatbuffers::uoffset_t i = 0; i < values->size(); ++i) {
    if (!VerifyContent(
        verifier,  values->Get(i), types->GetEnum<Content>(i))) {
      return false;
    }
  }
  return true;
}

